import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { getOwnProjects } from '../../store/actions/projectAction'

import styles from './ProjectManager.module.css'
import ProjectFolder from './projectManager/ProjectFolder'

const ProjectManager = ({setFirstTab}) => {
    const dispatch = useDispatch();
    const {auth, project} = useSelector(state=>state);

    useEffect(()=>{
        dispatch(getOwnProjects(auth))
    },[auth])
    
    return (
        <div className={styles.project}>
            <div className={styles.btn_group}></div>
            <ProjectFolder setFirstTab={setFirstTab} name='My project' projects={project.ownProjects} />
            <ProjectFolder setFirstTab={setFirstTab} name='Received project' projects={project.shareProjects} />
        </div>
    )
}

export default ProjectManager
